import React from 'react';
import './App.css';

function App() {
  state = {
    url: ""
  };

  componentDidMount = () => {
    this.setState({
      url: "https://source.unsplash.com/collection/1971015/400x400/?sig="
    });
  }
  const url = "https://source.unsplash.com/collection/1971015/400x400/?sig=";


  return (
    <div className="App">
      <header className="Header-Text">
        Good Morning!
      </header>
      <body className="Body-Picture">
        <img src={this.state.url} alt="unsplash"/>
      </body>
      <div className="Footer-Credits">
        Made with {"<3"} by  <a id="websiteLink" href="https://mesagoh.github.io"> Melissa Goh </a> , 2019
      </div>
    </div>
  );
}

export default App;
